import React from "react";
import "./App.css";
import Home from "./pages/Home/Home";
import Lang from "./pages/Lang/Lang";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Lang" element={<Lang />} />
      </Routes>
    </div>
  );
}

export default App;
